import React from 'react'
import DecktopIcon from './DesktopIcon/DecktopIcon';
import { NavLink } from 'react-router-dom';
import FolderIcon from "../../../Images/FolderIcon.png"
import MyComputerIcon from "../../../Images/MyComputer.png"
import s from "./Navbar.module.css";

const Navbar = () => {



    return (
        <div className={ s.Navbar }>
            <DecktopIcon isCoosing={false} image = { MyComputerIcon } name = {"Об олимпиаде"}/>
            <DecktopIcon image = { FolderIcon } name = {"Направления"}/>
            <DecktopIcon image = { FolderIcon } name = {"Этапы"}/>
            <DecktopIcon image = { FolderIcon } name = {"Спонсоры"}/>
            <DecktopIcon image = { FolderIcon } name = {"Регстрация"}/>
        </div>
    );
}


export default Navbar;
